import Card from "react-bootstrap/Card";
import './ReviewPane.css';
const ReviewPane = (reviewData) => {
   if(reviewData.reviewData){
       console.log(reviewData)
    return (
        <div>
            {reviewData.reviewData.map}
            {/* <Card>
                <Card.Body className="review-header">
                    <Card.Title className="reviewer">{reviewData.reviewData._source.reviewer}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted contributions">{reviewData.reviewData._source.contributions} Contributions</Card.Subtitle>
                </Card.Body>
                <Card.Body>
                    <Card.Title className="review-title">{reviewData.reviewData._source.review_title}</Card.Title>
                    <Card.Text className="comment">{reviewData.reviewData._source.comment}</Card.Text>
                </Card.Body>
            </Card> */}
        </div>
    );
   }else{
    return (
        <div>
            <Card>
                <Card.Body className="review-header">
                    <Card.Title className="reviewer">Sorry!, We don't have enough data to show.</Card.Title>
                </Card.Body>
            </Card>
        </div>
    );
   }
    
};
export default ReviewPane;
